import React, { useState } from "react";

function Kcreate() {

  const [note,setnote]=useState({
      title:'',
      note:''
  })  

  function onchange(e) {
    const name=e.target.name
    const value=e.target.value

    setnote((oldnote)=>{
        return {...oldnote,
        [name]:value}
    })
  }
  function onclick() {}

  return (
    <>
      <div className='creatediv'>
        <input type="text" placeholder="title" onChange={onchange} value={note.title}></input>
        <textarea type="text" placeholder="note" onChange={onchange} value={note.note}></textarea>
      <button onClick={onclick}>+</button>
      </div>
        
    </>
  );
}

export default Kcreate;
